            <h1 className='text-light text-center'>footer</h1>
            <p className='text-light text-center'>Copy Right by @DreamsHeart</p>
            <div className='col-lg-4 text-center float-left'>
              <img
                src='image/logo.png'
                alt='lofo'
                className='img-fluid w-50  '
              />
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
};
